import React from 'react';
import '../Registration/Registration.css';

class Login extends React.Component{
    render() {
    
            return (
              <div className="register">
                   <div className="background"></div>
                  <div className="background2"></div>
                   <div className="loginForm"> 
                        <hgroup>
                        {/* <span class="icon novi-icon icon-circle icon-bordered icon-lg icon-default mdi mdi-account-multiple-outline"></span> */}
                        </hgroup>
                        <form>
                        <div className="group">
                            <input type="text" placeholder="Name"/><span className="highlight"></span><span className="bar"></span>
                            {/* <label>Username</label> */}
                        </div>
                        <div className="group">
                            <input type="email" placeholder="Email"/><span className="highlight"></span><span className="bar"></span>
                            {/* <label>Username</label> */}
                        </div>
                        <div className="group">
                            <input type="text" placeholder="Mobile No"/><span className="highlight"></span><span className="bar"></span>
                            {/* <label>Password</label> */}
                        </div>
                        <div className="group">
                            <input type="text" placeholder="Verify Code"/><span className="highlight"></span><span className="bar"></span>
                            {/* <label>Password</label> */}
                        </div>
                        <div className="group">
                            <input type="password" placeholder="Password"/><span className="highlight"></span><span className="bar"></span>
                            {/* <label>Password</label> */}
                        </div>
                        <div className="group">
                            <input type="password" placeholder="Confirm Password"/><span className="highlight"></span><span className="bar"></span>
                            {/* <label>Password</label> */}
                        </div>
                        <button type="button" className="buttonui "> <span> Create Account </span>
                                <div className="ripples buttonRipples"><span className="ripplesCircle"></span></div>
                            </button>        
                        </form>
                        <div className="powered">
                            <a href="http://www.kvcodes.com"> Create New Register </a>
                        </div>
                    </div>
              </div>
            );
          }
}
export default Login;
